sys_variable_value.value:
current.description = current.variables.bed_type.getDisplayValue() + ' - ' + current.variables.bed_location.getDisplayValue();

var gr = new GlideRecord('x_bhrl_hbm_hospital_bed');
var bedType = current.variables.bed_type.toString();// '100017 - Total Electric Beds|Available';
var reqLocation = current.variables.bed_location;
var name = bedType.substr(0, bedType.indexOf('|'));// betType.split('|')[0];
//var status = betType.split('|')[1];
gr.addQuery('display_name', 'CONTAINS', name);
gr.addQuery('bed_location', reqLocation);
gr.query();
if(gr.next()){
workflow.scratchpad.IsMoving = false;
//gs.info(gr.display_name + gr.bed_location.getDisplayValue());

}
else{
workflow.scratchpad.IsMoving = true;
}

